import React from "react";
let items = [{Nombre:"HOME", ruta: "/"}, {Nombre: "FAVORITOS", ruta: "/favoritos"}];
import Navitems from "../Navitems/Navitems";

function Nav() {
    return (
    <nav>
        <ul className="main-nav">
            {items.map((elem) => <Navitems data={elem} />)} 
        </ul>
        <ul className="user">
            <li>Walter White <img src="" alt=""/></li>
        </ul>
    </nav>
    )
}

export default Nav;
